import React, { Component } from "react";
import axios from "axios";

class CarInventory extends Component {
  state = {
    cars: []
  };

  componentDidMount() {
    this.getCars();
  }

  getCars = () => {
    axios("http://localhost:5000")
      .then(data => {
        console.log(data.data.cars);
        this.setState({ cars: data.data.cars });
      })
      // .then(({response}) => this.setState({users: response.users}))
      .catch(error => console.log(error));
  };

  showCars = car => (
    <div key={car.id} className="car-model">
      <div className="car-image">
        <img src="" />
      </div>
      {console.log(typeof car.image)}
      <div className="car-content">
        <h1>{car.title}</h1>
        <div className="mileage">
          mileage: <span>23,000</span>
        </div>
        <div className="price">
          price: <span>$89,000</span>
        </div>
      </div>
    </div>
  );

  render() {
    const { cars } = this.state;
    return (
      <div className="carInventory">
        <div className="car-container">{cars.map(this.showCars)}</div>
      </div>
    );
  }
}

export default CarInventory;
